import { Container } from "react-bootstrap"
import Buttons from "./components/buttons";
import { persons } from "./data"
import List from "./components/list";
import Count from "./components/header"
import React, { useState } from "react";
function App() {

  const [dataPerson, setDataPerson] = useState(persons)
  const onDelete =()=>{
          setDataPerson([])
  }
  const viewData =()=>{
          setDataPerson(persons)
  }
  return ( 
    <Container className="py-5 font body " >

    <Count persons={dataPerson} />

    <List persons={dataPerson} />
    <Buttons fun={onDelete} view={viewData}/>
    </Container>

  );
}

export default App;
